// import { useSelector, } from "react-redux";
import { deletRow } from "../../redux";

function Body({tableList, dispatch}){
    // const tableList = useSelector()
    return <tbody>
        {tableList.length > 0
        && tableList.map(row => <tr key={row.id}>
            <td>{row.name}</td>
            <td>{row.age}</td>
            <td><button type="button" onClick={() =>{dispatch(deletRow(row.id))} }>-</button></td>
        </tr>)}
    </tbody>
}

export default Body;
